import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 18.2-91 Entering dwelling house, etc., with intent to commit larceny, assault and battery or other felony.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-91.md","filePath":"vacode/18.2-91.md"}'),n={name:"vacode/18.2-91.md"},o=a('<h1 id="§-18-2-91-entering-dwelling-house-etc-with-intent-to-commit-larceny-assault-and-battery-or-other-felony" tabindex="-1">§ 18.2-91 Entering dwelling house, etc., with intent to commit larceny, assault and battery or other felony. <a class="header-anchor" href="#§-18-2-91-entering-dwelling-house-etc-with-intent-to-commit-larceny-assault-and-battery-or-other-felony" aria-label="Permalink to &quot;§ 18.2-91 Entering dwelling house, etc., with intent to commit larceny, assault and battery or other felony.&quot;">​</a></h1><p>If any person commits any of the acts mentioned in § <a href="http://law.lis.virginia.gov/vacode/18.2-90/" target="_blank" rel="noreferrer">18.2-90</a> with intent to commit larceny, or any felony other than murder, rape, robbery or arson in violation of §§ <a href="http://law.lis.virginia.gov/vacode/18.2-77/" target="_blank" rel="noreferrer">18.2-77</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-79/" target="_blank" rel="noreferrer">18.2-79</a> or § <a href="http://law.lis.virginia.gov/vacode/18.2-80/" target="_blank" rel="noreferrer">18.2-80</a>, or if any person commits any of the acts mentioned in § <a href="http://law.lis.virginia.gov/vacode/18.2-89/" target="_blank" rel="noreferrer">18.2-89</a> or § <a href="http://law.lis.virginia.gov/vacode/18.2-90/" target="_blank" rel="noreferrer">18.2-90</a> with intent to commit assault and battery, he shall be guilty of statutory burglary, punishable by confinement in a state correctional facility for not less than one or more than twenty years or, in the discretion of the jury or the court trying the case without a jury, be confined in jail for a period not exceeding twelve months or fined not more than $2,500, either or both. However, if the person was armed with a deadly weapon at the time of such entry, he shall be guilty of a Class 2 felony.</p><p>Code 1950, § 18.1-89; 1960, c. 358; 1962, c. 505; 1970, c. 381; 1975, cc. 14, 15, 602; 1991, c. 710; 1992, c. 486; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP1040" target="_blank" rel="noreferrer">1040</a>; 1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0832" target="_blank" rel="noreferrer">832</a>.</p>',3),i=[o];function l(c,s,h,f,d,g){return t(),r("div",null,i)}const _=e(n,[["render",l]]);export{m as __pageData,_ as default};
